    #procurar arquivo
    def arquivo_procurar(self):
        arquivos = QtWidgets.QFileDialog.getOpenFileNames(filter="Arquivo de dados (*.txt *.csv *.xlsx)")[0]
        if len(arquivos) >0:
            nomes = arquivos[0].split("/")[-1]
            for index in range(1,len(arquivos)):
                nomes = nomes + ", " + arquivos[index].split("/")[-1]
            self.Caminho_arquivo.setText(nomes)
            return arquivos
        
                    
            
